void Ext_HTA::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"alloc_layer_V\" :  \"" << alloc_layer_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"alloc_layer_V_ap_vld\" :  \"" << alloc_layer_V_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"alloc_layer_V_ap_ack\" :  \"" << alloc_layer_V_ap_ack.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"alloc_target_V\" :  \"" << alloc_target_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"alloc_target_V_ap_vld\" :  \"" << alloc_target_V_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"alloc_target_V_ap_ack\" :  \"" << alloc_target_V_ap_ack.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"alloc_allocated_addr_V\" :  \"" << alloc_allocated_addr_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"alloc_allocated_addr_V_ap_vld\" :  \"" << alloc_allocated_addr_V_ap_vld.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"alloc_allocated_addr_V_ap_ack\" :  \"" << alloc_allocated_addr_V_ap_ack.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"alloc_cmd\" :  \"" << alloc_cmd.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"alloc_cmd_ap_vld\" :  \"" << alloc_cmd_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"alloc_cmd_ap_ack\" :  \"" << alloc_cmd_ap_ack.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

